description:
Kung Fu Quest II

Culture Documentary hosted by Stephen Au and Luo Jun Jie and Chen Zhi Zhong and Li Jia and Philip Ng and Yang Yong Ji and Wan Zhao Ji and Yan Shao Qiang and Qiao Jing Fu and Peng Gang Yuan and Luo Hao Ming and Han Zhuo Jian and Luo Jun Hao, published by RTHK in 2012 - Chinese narration


Information
------------------------------

Modern Chinese martial arts practitioners are constantly seeking the roots as well as new development for Kung Fu through various media. &quot;Kung Fu Quest II&quot; again started off with the five genres of martial artists seeking various philosophies and stories for this ancient culture. Along the journey with these skilled masters, you would experience the life-inspiring characters, vitality and spirits of the language of Chinese martial arts. 
Part 1: The Origin Of Form And Meaning
Part 2: Three Types Of Martial Skills
Part 3: The Awe-Inspiring Ba Ji Quan
Part 4: Northern And Southern Praying Mantis
Part 5: White Crane Boxing
Part 6: Okinawan Karate

